import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'

export default class App extends Component {
  render() {
    return (
      // login page
      // <Login/>

      // header

      // body

      // test

      <Router>
        <Header/>
        <Switch>
          <Route path="/login"><Login/></Route>
          <Route path="/"> 
            <HomeBody/>
            <Footer/> 
          </Route>
        </Switch>
      </Router>
    );
  }
}
